import React from "react";


function Signup(){
    function handleClick(){
        //const billNum = document.getElementByName('generatehead3')[0].value
        const user1=document.getElementById('title').value
        console.log(user1)
        const pass1=document.getElementById('Detail').value
        const pass2=document.getElementById('date1').value
        

        const val={title:user1, Detail:pass1, date1:pass2};
        console.log(val)
                    console.log(user1)
                    
                      fetch('http://localhost:8000/userinput', {
                                    method: 'POST',
                                    headers: {
                                        "Content-Type": "application/json",
                                      },
                                      body: JSON.stringify(val),
                                    
                                  
                                })
                                  
                                
       }
    return (
        <div className="signupmain">
        <div className="sucontainer">
        
        <div className="sucontainer2">
            <h2>User  Registration</h2>
        <form action="http://localhost:8000/signup" method="POST">
            <div className="row">
                <div className="col-lg-6 col-md-6 col-sm-12"><input type="text" name="userName" className="fname" id="userName" placeholder="userName"></input></div>
                
                <div className="col-lg-6 col-md-6 col-sm-12">  <input type="text" name="contact" className="phnum" id="Contact" placeholder="Contact"></input></div>
                <div className="col-lg-6 col-md-6 col-sm-12">   <input type="email" name="mail" className="mail" id="e-mail" placeholder="e-mail"></input></div>
                <div className="col-lg-6 col-md-6 col-sm-12">   <input type="password" name="password" className="pass" id="instaid" placeholder="instaid"></input></div>
                
                <div className="col-lg-6 col-md-6 col-sm-12">   <input type="password" name="password" className="pass" id="password" placeholder="password"></input></div>
                <div className="col-lg-6 col-md-6 col-sm-12">  <input type="password" name="cpassword" className="pass" id="confirm password" placeholder="confirm password"></input></div>
                  <button type="submit" className="btn btn-primary" name="submit" onClick={handleClick}>Register</button>          
            
            </div>
        </form>
        
        </div>
        </div>
    </div>
    )
}

export default Signup;
